        <div className='product'>
            <img src={img} alt="" />
            <p className='product-name'>{name}</p>
            <p>price: ${price}</p>
            <p><small>Seller : {seller}</small></p>
            <p><small>Rating: {}</small></p>
        </div>
    );
};

export default Product;
